import "./CityCard.css"
import { TiDeleteOutline } from 'react-icons/ti';
import { useEffect } from "react";

function CityCard({name}) {
    useEffect(()=>{
        /*fetch('`https://api.openweathermap.org/data/2.5/forecast?q=London,uk&APPID=3b38d9cd69cbc01a769e639cdf78004d').then(res => JSON.parse(response)).then(data => console.log(data)).catch((err) =>console.log(err))*/
        const fetchData = async() =>  {

            const res = await fetch('`https://api.openweathermap.org/data/2.5/forecast?q=London,uk&APPID=3b38d9cd69cbc01a769e639cdf78004d');
            console.log(res)
            const data = await res.json();
        
            console.log(data);
        
        }
    },[])
    

    return (
        <div class="citycard">
            <div class="weathericon">
                <img style={{ height: '7rem' }} src="https://img.icons8.com/nolan/452/smiling-sun.png"></img>
            </div>
            <div class="text">
                <div class="city">{name}</div>
                <div class="temp">20.1°C</div>
            </div>
            <div class="buttons">
                <div class="delete">
                    <div class="deletetext">Usuń</div>
                    <TiDeleteOutline size={'1.5rem'} style={{ color: "rgb(72, 72, 72)" }} />
                </div>
                <div class="info">
                    <div class="infobutton">O mieście</div>
                </div>
            </div>
        </div>
    )
}

export default CityCard
